import { connect } from "react-redux";
import axios from "axios";
import React,{useEffect,Fragment} from 'react'
import {getLangs} from "../../actions/langs"
const Battle = ({battle_result }) => { 
    const [formData,setformData]=useState({
        user1:'',
        user2:''
      });
      const{user1,user2}=formData;
      const onChange=(e)=>{
       setformData({...formData,[e.target.name]:e.target.value}); 
      }
      const onSubmit=async (e)=>{
        e.preventDefault();

      }
      return (
        <section className="container">
        <h1 className="large text-primary">Sign In</h1>
        <p className="lead"><i className="fas fa-user"></i> Signin To Your Account</p>
        <form className="form" onSubmit={e=>onSubmit(e)} >
          <div className="form-group">
            <input type="text" placeholder="User 1" name="user1" value={user1} onChange={e=>onChange(e)} />

          </div>
          <div className="form-group">
          <input type="text" placeholder="User 2" name="user2" value={user2} onChange={e=>onChange(e)} />

          </div>

          <input type="submit" className="btn btn-primary" value="Submit" />
        </form>
        </section>

      );
};


const mapStateToProps = state => ({
  battle_result: state.battle,
});

export default connect(mapStateToProps,{getLangs} )(Battle);
